import React from 'react';

const DashboardPage = () => {
  return (
    <div>
      <header>
        <nav>
          <h1>Nixcel - Employee Management System</h1>
        </nav>
      </header>
      <main>
        <div className="main-content">
          <div className="row">
            {/* Render your cards here */}
          </div>
        </div>
      </main>
      <footer>
        <div className="footer-left">
          <p>Copy Rights @ <span style={{ color: 'black' }}>Nixcel Software Solution 2024</span></p>
        </div>
        <div className="footer-right">
          <a href="https://www.bing.com/ck/a?!&&p=d0ceae804a048b5dJmltdHM9MTcxMDcyMDAwMCZpZ3VpZD0xMmQ4ZDY0OC05ZWJkLTZlZDAtMzc5Zi1jMjc1OWYwZjZmYzImaW5zaWQ9NTIxOA&ptn=3&ver=2&hsh=3&fclid=12d8d648-9ebd-6ed0-379f-c2759f0f6fc2&psq=standard+company+website+privacy+policy+.+term+%26+conditions+government+of+india&u=a1aHR0cHM6Ly9kYXJwZy5nb3YuaW4vc2l0ZXMvZGVmYXVsdC9maWxlcy9naWd3LW1hbnVhbF9SZXZpc2VkMjAxOC5wZGY&ntb=1">
            <span style={{ color: 'black' }}>Privacy Policy . Term & Conditions</span>
          </a>
        </div>
      </footer>
    </div>
  );
};

export default DashboardPage;
